const secretText = parcel.getFeatureById('secret-text-2');

feature.on('click', e=> {
  secretBookcase.position.z = -13.15;
  secretText.position.x = 13.75;
  setTimeout(() => {
    secretBookcase.position.z = -11.85;
    secretText.position.x = 13.8;  
  }, 90000);
});

